import './App.css';
import { BrowserRouter, Routes, Route, Outlet } from 'react-router-dom';
import ShopRouters from './ShopRouters';
import Header from './components/Header/Header';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <ShopRouters />
        <Outlet />
      </BrowserRouter>
    </div>
  );
}

export default App;
